import React from 'react';
import './Profile.css';

const Profile = () => {
  return (
    <div className="profile-modal">
      <div className="profile-header">
        <button className="upload-photo-btn">Upload Photo</button>
      </div>
      <h2>Vikash Dubey</h2>
      <button className="edit-btn">Edit</button>
      <button className="add-pronunciation-btn">+ Add name pronunciation</button>
      <div className="status">
        <span className="status-indicator"></span> Active
      </div>
      <div className="local-time">3:14 PM local time</div>
      <div className="status-options">
        <button className="status-btn">Set a status</button>
        <select className="view-as-select">
          <option>View as</option>
          {/* other options */}
        </select>
        <button className="more-options-btn">...</button>
      </div>
      <h3>Contact information</h3>
      <button className="edit-contact-btn">Edit</button>
      <div className="email-address">vikash7618@gmail.com</div>
      <button className="add-phone-btn">+ Add Phone</button>
    </div>
  );
};

export default Profile;
